import React, { Component } from 'react';
import { Router } from '@reach/router';
import './App.css';
import Home from './pages/Home';
import Images from './pages/Images';
import Videos from './pages/Videos';
import About from './pages/About';
import logo from './logo.svg';
function App(){
  const navLinks =[
    {
      text: 'Home',
      path: '/Home',
      icon:'ion-ios-home'
    },
    {
      text: 'Images',
      path: '/Images',
      icon:'ion-ios-images'
    },
    {
      text: 'Videos',
      path: '/Videos',
      icon:'ion-ios-videocam'
    },
    {
      text: 'About Me',
      path: '/About',
      icon:'ion-ios-home'
    }
  ]
  return(
<div className="App">
  <Router>
    <Home path="/home"/>
    <Images path="/images"/>
    <Videos path="/videos"/>
    <About path="/about"/>
  </Router>
</div>
  );
}
export default App;
